// src/FinalPay.js
import React from 'react';
import './FinalPay.css';

const FinalPay = () => {
  return (
    <div className="final-pay">
      <div className="left-section">
        <h1>Information you need to pay attention</h1>
        <h2>Passengers are divided into categories.</h2>
        <img 
          src="your-image-url.jpg" 
          alt="Description"
          className="rounded-image"
        />
        <h1>Your Trip Summary</h1>
        <h2>
          Your flight takes off from ARN Gate 23A, you enter through C Entrance. 
          In FCO Airport in Rome, you will stay 3h & 45m then exit through Gate D14. 
          Final destination will be SABIHA Airport and you can exit through L Door.
        </h2>
        <div className="dropdowns">
          <div className="dropdown">
            <label htmlFor="reviews">Reviews: </label>
            <select id="reviews">
              <option>Good</option>
              <option>Bad</option>
              <option>Worst</option>
            </select>
          </div>
          <div className="dropdown">
            <label htmlFor="sustainability">Sustainability level: </label>
            <select id="sustainability">
              <option>Low</option>
              <option>Medium</option>
              <option>High</option>
            </select>
          </div>
        </div>
      </div>
      <div className="right-section">
        <h1>Payment method and Information</h1>
        {/* Add more content here as needed */}
      </div>
    </div>
  );
};

export default FinalPay;
